import React from 'react';
import Button from './Button';
function ButtonName(){
   
        const name1={
            src:"https://web.archive.org/web/20210903175340im_/https://res.cloudinary.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,h_108/play_ip0jfp",
            height:"54px"
        }
        const name2 = {
            src:"https://www.google.com/imgres?imgurl=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fcommons%2Fthumb%2F3%2F3c%2FDownload_on_the_App_Store_Badge.svg%2F2560px-Download_on_the_App_Store_Badge.svg.png&imgrefurl=https%3A%2F%2Fcommons.wikimedia.org%2Fwiki%2FFile%3ADownload_on_the_App_Store_Badge.svg&tbnid=tnUTUA2OorALGM&vet=12ahUKEwjJ4rXC0fvyAhWVeCsKHQQZCxcQMygAegUIARC-AQ..i&docid=XQTbCUoQLsrj1M&w=2560&h=759&q=download%20on%20the%20app%20store&ved=2ahUKEwjJ4rXC0fvyAhWVeCsKHQQZCxcQMygAegUIARC-AQ",
            height:"54px"
        }
    return (
        <div>
        <Button data={name1}></Button>
        <Button data={name2}></Button>
        </div>
    )
}
export default ButtonName;
